func TestHeapSortAscending(t *testing.T) {
	actual := []int{29, 54, 4, 8, 427, 737, 330, 522, 134, 742}
	expected := []int{29, 54, 4, 8, 427, 737, 330, 522, 134, 742}
	HeapSortAscending(actual)
	slices.Sort(expected)
	assert.Equal(t, expected, actual)
}

func TestHeapSortAscending_Sorted(t *testing.T) {
	actual := []int{4, 8, 29, 58}
	expected := []int{4, 8, 29, 58}
	HeapSortAscending(actual)
	assert.Equal(t, expected, actual)
}

func TestHeapSortAscending_SortedReversed(t *testing.T) {
	actual := []int{58, 29, 8, 4}
	expected := []int{4, 8, 29, 58}
	HeapSortAscending(actual)
	assert.Equal(t, expected, actual)
}

